  ["honourers"] = "<html><body><h1>honourers</h1><p>honourer<p></p>n.<p></p>honour的变形<p></p>honour<p></p>['ɔnə]<p></p>n.<p></p>荣誉，光荣<p></p>名誉，声誉，信誉；面子，体面<p></p>节操，廉耻<p></p>正义感，道义；自尊<p></p>尊敬，敬意<p></p>[复数]礼仪，仪式<p></p>光荣的人(或事物)；荣耀<p></p>徽章，勋章；敬礼式；荣典<p></p>[复数]叙勋，授勋<p></p>[复数](尤指大学生的)优等；高级课程<p></p>(所受到的)荣幸，款待<p></p>高位，显职；封号<p></p>[常作H-](前与his， your等连用)阁下；大人<p></p>(女性的)纯洁，贞操<p></p>(竞赛等的)奖励；比赛奖金<p></p>=honor point<p></p>=honor card<p></p>【高尔夫球】先打权，开球权<p></p>[古语]屈膝礼；鞠躬<p></p>adj.<p></p>荣誉的，名誉的；与名誉有关的<p></p>vt.<p></p>尊敬，尊重；敬重，仰慕：<p></p>He will be always honoured by the people.<p></p>他将永远受到人民的敬仰。<p></p>You must honour him who will honour you.<p></p>你必须尊重别人，他才会尊重你。<p></p>向…表示敬重；授予…的荣誉(或职位等)：<p></p>Everybody stood up and warmly applauded to honour his coming.<p></p>所有的人都从座位上站起来热烈鼓掌，对他的到来表示敬意。<p></p>He was honoured with the Nobel prize for medicine in 2002.<p></p>他曾获2002年度诺贝尔生理学或医学奖。<p></p>礼待；有幸，使增光：<p></p>John told me that the President would honour me by meeting me in the White House.<p></p>约翰告诉我，总统要在白宫接见我。<p></p>I'll be greatly honoured by your gracious presence.<p></p>如蒙光临，不胜荣幸。<p></p>执行，施行；批准，承认…有效：<p></p>I only honoured my promise to your father.<p></p>我只不过完成了我对你父亲的承诺。<p></p>Your application to join the club was honoured.<p></p>你加入俱乐部的申请获得批准了。<p></p>【商业】承兑(汇票等)，承认并如期支付(支票、票据)<p></p>【方形舞】向…鞠躬(致意)<p></p>【宗教】礼拜，膜拜(上帝)<p></p>近义词:<p></p>homage<p></p>. reverence<p></p>. deference<p></p>短语:<p></p>do honour to (someone)<p></p>给(某人)带来荣誉，给(某人)增光<p></p>对(某人)表示敬意，尊敬地对待(某人)<p></p>do the honours (of)<p></p>作主妇(或主人)招待，尽地主之谊<p></p>(feel) bound in honour (或 in honour bound) to do (something)<p></p>(感到)在道义上有责任做(某事)<p></p>for honour of<p></p>为顾全…的信用<p></p>for the honour of<p></p>为了…的声誉<p></p>give one's (word of) honour<p></p>以名誉担保<p></p>have the honour<p></p>有幸，荣幸<p></p>Honours(are)even.<p></p>【牌戏】双方持有同等数目的大牌。<p></p>力量(或实力等)均等，势均力敌。<p></p>in honour of<p></p>向…表示敬意；为纪念…；为了庆祝…<p></p>on(或upon)one's honour<p></p>以名誉担保，这的确属实<p></p>put someone on his honour<p></p>使某人立誓保证<p></p>to someone's honou