  ["huddlers"] = "<html><body><h1>huddlers</h1><p>huddler<p></p>n.<p></p>huddle的变形<p></p>huddle<p></p>['hʌdl]<p></p>vt.<p></p>把…胡乱堆积(或紧挤在一起)：<p></p>He huddled his books in the corner of his bedroom.<p></p>他把书胡乱堆积在他卧室的一角。<p></p>to huddle one's clothes into the drawer<p></p>把衣服胡乱塞在抽屉里<p></p>乱推，乱搡：<p></p>People huddled one another into the hall.<p></p>人们推推搡搡地拥进了大厅。<p></p>使缩成一团，使蜷缩(常与up连用)；偎依在…旁边(与against连用)：<p></p>I saw him huddling himself up under the table when I went into the room.<p></p>我走进屋时看见他正蜷缩在桌子下面。<p></p>to huddle oneself up against someone<p></p>蜷缩在某人的身旁<p></p>紧裹，紧包，紧围(与in 连用)：<p></p>She huddled herself in the blanket.<p></p>她用毯子紧紧裹住自己。<p></p>胡乱(或匆忙)穿上(与on连用)：<p></p>He huddled on his robe and ran into the room to answer the telephone.<p></p>他匆忙穿上浴袍，跑进屋内去接电话。<p></p>草率完成；仓促做成(与through， up连用)：<p></p>Jim huddled up an agreement with Harding Co. Ltd. and flew back New York this morning.<p></p>今天上午吉姆匆匆与哈丁公司签订了一份合同，接着就乘飞机返回了纽约。<p></p>to huddle work through<p></p>草草做完工作<p></p>[古语]催赶，乱轰乱赶<p></p>vi.<p></p>挤作一团；聚集，群集：<p></p>We huddled together on a small boat.<p></p>我们在一条小船上挤作一团。<p></p>People huddled around the theatre in order to have a look at her beauty.<p></p>人们聚集在剧场的周围，以便一睹她的芳容。<p></p>碰头商议；[口语]会面，接头：<p></p>We discussed where to huddle.<p></p>我们商量好了在哪儿会面。<p></p>缩成一团，蜷缩(与up连用)：<p></p>They huddled up around the fire.<p></p>他们蜷缩着围挤在火旁。<p></p>偎依(与against连用)：<p></p>Her pet dog huddled against her.<p></p>她的爱犬偎依在她的身边。<p></p>[美国英语]上班时打盹儿：<p></p>He was found to huddle by his boss.<p></p>他的老板发现他在上班时打盹儿。<p></p>【美式橄榄球】在对阵争球线的后面集合听取临赛前指示<p></p>n.<p></p>混乱，杂乱，一团糟<p></p>杂乱的一群(或一团、一堆)<p></p>(足球比赛等的)赛前指导会<p></p>[口语]秘密的商量；私下碰头会；会议<p></p>【美式橄榄球】队员临赛前在对阵争球线后面举行的指示听取会<p></p>变形：<p></p>vt.<p></p>huddled<p></p>. huddling</p></body></html>",
